void fusion(int basse, int millieu, int haute)
{
	int* gauche = malloc(sizeof(int) * (millieu - basse + 1));
	int* droite = malloc(sizeof(int) * (haute - millieu));

	// n1 is size of gauche part and n2 is size
	// of droite part
	int n1 = millieu - basse + 1, n2 = haute - millieu, i, j;

	// storing values in gauche part
	for (i = 0; i < n1; i++)
		gauche[i] = array[i + basse];

	// storing values in droite part
	for (i = 0; i < n2; i++)
		droite[i] = array[i + millieu + 1];

	int k = basse;
	i = j = 0;

	// fusion gauche and droite in ascending order
	while (i < n1 && j < n2) {
		if (gauche[i] <= droite[j])
			array[k++] = gauche[i++];
		else
			array[k++] = droite[j++];
	}

	// insert remaining values from gauche
	while (i < n1) {
		array[k++] = gauche[i++];
	}

	// insert remaining values from droite
	while (j < n2) {
		array[k++] = droite[j++];
	}
	free(gauche);
	free(droite);
}

// fusion sort function
void fusion_sort(int basse, int haute)
{
	// calculating millieu point of array
	int millieu = basse + (haute - basse) / 2;
	if (basse < haute) {
		// calling first half
		fusion_sort(basse, millieu);

		// calling second half
		fusion_sort(millieu + 1, haute);

		// merging the two halves
		fusion(basse, millieu, haute);
	}
}

// thread function for multi-threading
void* fusion_sort_func(void* arg)
{
	// which part out of THREAD_MAX parts
	int thread_part = part++;

	// calculating basse and haute
	int basse = thread_part * (MAX / THREAD_MAX);
	int haute = (thread_part + 1) * (MAX / THREAD_MAX) - 1;

	// evaluating millieu point
	int millieu = basse + (haute - basse) / 2;
	if (basse < haute) {
		fusion_sort(basse, millieu);
		fusion_sort(millieu + 1, haute);
		fusion(basse, millieu, haute);
	}
	return arg;
}

int main()
{
	// t1 and t2 for calculating time for fusion sort
	clock_t t1, t2;

	t1 = clock();
	thread_t threads[THREAD_MAX];

	// creating THREAD_MAX threads
	for (int i = 0; i < THREAD_MAX; i++)
		thread_create(&threads[i], fusion_sort_func, (void*)NULL);

	// joining all THREAD_MAX threads
	for (int i = 0; i < THREAD_MAX; i++)
		thread_join(threads[i], NULL);

	// merging the final THREAD_MAX parts
	fusion(0, (MAX / 2 - 1) / 2, MAX / 2 - 1);
	fusion(MAX / 2, MAX / 2 + (MAX - 1 - MAX / 2) / 2, MAX - 1);
	fusion(0, (MAX - 1) / 2, MAX - 1);

	t2 = clock();

	//	 displaying sorted array
	//	printf("Sorted array: \n");
	//	for (int i = 0; i < MAX; i++)
	//		printf("%d ", array[i]);

	// time taken
	printf("\nTime taken: %f \n", (t2 - t1) / (double)CLOCKS_PER_SEC);

	return 0;
}